import React from "react";

const Home = () => {
  return (
    <div className="w-screen h-screen absolute top-0 bg-red">
      <div className="w-[60%] absolute top-[70px]  items-center flex justify-center grid grid-cols-2">
        <div className="h-full w-full bg-dark"></div>
        <h1>DAAAAAA</h1>
        <div></div>
      </div>
    </div>
  );
};

export default Home;
